<script>
    import {onMount} from "svelte";
    import {getDocs, collection, doc} from "firebase/firestore";
    import {db} from "$lib/firebase";
    import {page} from '$app/stores';
    import {authStore} from "../../../store/store.js";
    import Qris from "../../../components/Qris.svelte";
    import ShopeePay from "../../../components/ShopeePay.svelte";
    import Bca from "../../../components/Bca.svelte";
    import QRCode from '@castlenine/svelte-qrcode';
    import { fade, scale, slide, fly, blur } from "svelte/transition"
    import { flip } from "svelte/animate"
    import { goto } from "$app/navigation"

    // Get the current path
    $: currentPath = $page.url.pathname;
    let showQrisCode = false;
    let generateQris = false;

    $: value = '';
    $: message = '';
    let copied = false;
    let copiedMessage = '';
    let bgCopiedMessage = '';

    function formatCurrency(event) {
        let input = event.target.value.replace(/[^0-9.]/g, '');

        // Ensure only one decimal point
        const parts = input.split('.');
        if (parts.length > 2) {
            parts[1] = parts.slice(1).join('');
            input = parts.join('.');
        }

        // Limit to two decimal places
        if (parts.length > 1) {
            parts[1] = parts[1].slice(0, 2);
            input = parts.join('.');
        }

        // Add commas for thousands
        parts[0] = parts[0].replace(/\B(?=(\d{3})+(?!\d))/g, ",");

        value = 'Rp ' + parts.join('.');
    }

    function isNominalEmpty() {
        let toEvaluate = value.trim();
        return !value || toEvaluate.replaceAll('0', '') === 'Rp';
    }

    function clearCurrency() {
        if (isNominalEmpty()) {
            value = ''
        }
    }

    function parseNumericValue(val) {
        // Remove currency symbol, commas, and convert to float
        let parsed = parseFloat(val.replace(/[^\d.]/g, ''));
        return isNaN(parsed) ? 0 : parsed
    }

    onMount(() => {
        authStore.update(u => ({...u, currentPath: currentPath}));
    });

    async function qris() {
        if (isNominalEmpty()) {
            return;
        }

        generateQris = true;
        showQrisCode = false;
        authStore.update(u => ({
            ...u, qris: {
                ...u.qris,
                string: ''
            }
        }));

        const amount = parseNumericValue(value);
        const body = {
            agree: true,
            notUnderage: true,
            message: message,
            amount,
            payment_type: "qris",
            vote: "",
            currency: "IDR",
            customer_info: {
                first_name: $authStore.user.name,
                email: "invited_guests@gmail.com",
                phone: ""
            }
        }

        try {
            // const response = await fetch(`/api/donations/${$authStore.qris.id}`, {
            const response = await fetch(`https://backend.saweria.co/donations/${$authStore.qris.id}`, {
                method: 'POST',
                body: JSON.stringify(body),
                headers: {
                    'Content-type': 'application/json',
                    'Authorization': 'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..viXPJa9OFoyNx7tV-VSupQm3DJgPS5t9BRy8z6a-9Ss',
                },
            });
            if (!response.ok) throw new Error('Network response was not ok');
            const data = await response.json();
            console.log(data);

            authStore.update(u => ({
                ...u, qris: {
                    amount,
                    amountString: value,
                    string: data.data.qr_string,
                    id: u.qris.id,
                    json: data.data.id
                }
            }));


            showQrisCode = true;
            value = '';
            message = '';
            generateQris = false;

        } catch (err) {
            console.error(err);
        }
    }

    function bca() {
        copiedMessage = 'Akun BCA tersalin';
        bgCopiedMessage = '#003298';
        copied = true;
        navigator.clipboard.writeText('7910819997');
        setTimeout(() => {
            copied = false;
            copiedMessage = '';
            bgCopiedMessage = '';
        }, 2000);
    }

    function shopeePay() {
        copiedMessage = 'Akun Shopee Pay tersalin';
        bgCopiedMessage = '#ED4E2C';
        copied = true;
        navigator.clipboard.writeText('085746335508');
        setTimeout(() => {
            copied = false;
            copiedMessage = '';
            bgCopiedMessage = '';
        }, 2000);
    }

    function closeQris() {
        showQrisCode = false;
    }

    function showRecentQris() {
        showQrisCode = true;
    }

</script>
<div in:slide={{duration: 500, delay: 300 }} out:blur={{duration: 300}} class="relative w-full  px-5 pt-8 pb-24 flex flex-col items-center h-full bg-gradient-to-t from-wedding-200 to-pink-100 text-wedding-600 gap-3  text-sm">
    {#if showQrisCode && $authStore.qris.string}
        <div on:click={closeQris}
             class="absolute  flex flex-col p-3 border border-gray-300 z-40 top-0 opacity-80 bg-gray-700  w-full h-full">
        </div>
        <div class="absolute w-[80%] self-center flex flex-col py-5  max-w-[50rem] gap-3 px-4 py-3 items-center rounded-xl border border-gray-300 z-50 top-0 bg-gray-100 top-[10%] ">
            <Qris class="w-24 h-24 fill-pink-600"></Qris>
            <QRCode data="{$authStore.qris.string}"
                    logoInBase64="data:image/png;base64,"
                    color="#db2777"/>
            <div class="flex flex-col justify-center items-center gap-1 w-full">
                <span class="font-bold text-base">{$authStore.qris.amountString}</span>
                <div class="flex flex-row items-center gap-2">
                    <span class="icon-[icon-park-twotone--people]"></span>
                    <span>Saweria</span>
                </div>
                <div class="flex flex-row items-start gap-2 -mb-3 mt-2">
                    <i class="text-xs text-pink-700">*</i>
                    <i class="text-xs text-pink-700">Scan QRIS berikut atau screenshoot/download</i>
                </div>
            </div>

        </div>
    {/if}

    {#if copied}
        <div class="z-40 border max-w-[50rem] border-gray-100 absolute w-[80%] self-center top-3 p-4 mb-4 text-sm text-white rounded-lg"
             style="background-color: {bgCopiedMessage}" role="alert">
            <span class="font-medium font-bold">{copiedMessage}</span>
        </div>
    {/if}


    <div class="flex flex-row justify-center item-center items-center gap-3 w-full text-wedding-500 -mt-5">
        <span class="icon-[fa--gift] w-16 h-16"></span>
        <h2 class="text-sm font-semibold mt-1">Tanpa mengurangi rasa hormat, bagi anda yang ingin memberikan tanda kasih
            untuk mempelai dapat melalui:</h2>
    </div>

    <div class="relative max-w-[50rem] w-full pt-5 pb-3 px-4 bg-wedding-100  border border-wedding-200 rounded-lg  flex gap-3 flex-col ">
        {#if generateQris}
            <div class="absolute flex flex-col w-full items-center justify-center h-full bg-gray-100 opacity-80 top-0 left-0 rounded-lg z-30">
                <span class="font-bold text-pink-700 ">Sedang membuat kode QRIS...</span>
            </div>
        {/if}
        <Qris class="w-24 h-24 fill-pink-600"></Qris>
        <div class="flex flex-col gap-1 text-wedding-500 ml-1 z-10 w-full">
            <div class="flex flex-row items-center gap-2">
                <span class="icon-[icon-park-twotone--people]"></span>
                <span class="font-bold">Saweria</span>
            </div>
            <input type="text" bind:value={value} on:blur={clearCurrency} on:input={formatCurrency}
                   class="outline-wedding-500 bg-wedding-50 border border-wedding-300 text-wedding-700 placeholder-wedding-300  text-sm rounded-lg focus:ring-wedding-500 focus:border-wedding-500 block w-full p-2.5"
                   placeholder="Inputkan Nominal...">
            <input type="text" bind:value={message}
                   class="outline-wedding-500 bg-wedding-50 border border-wedding-300 text-wedding-700 placeholder-wedding-300  text-sm rounded-lg focus:ring-wedding-500 focus:border-wedding-500 block w-full p-2.5"
                   placeholder="Catatan...">
            <div class="flex flex-row gap-2">
                <div class="flex w-fit mt-1 w-full">
                    <a href="#" on:click={qris}
                       class="items-center pl-3 w-full pr-4 py-2 text-sm text-center text-white bg-wedding-500 hover:bg-wedding-600 rounded-lg  focus:ring-4 focus:outline-none focus:ring-wedding-300 ">
                        <div class="flex flex-row gap-2 justify-between">
                            <span>Buat QRIS dan Scan</span>
                            {#if generateQris}
                                <span class="icon-[line-md--loading-twotone-loop] w-5 h-5"></span>
                            {:else}
                                <span class="icon-[mingcute--qrcode-2-fill] w-5 h-5"></span>
                            {/if}
                        </div>
                    </a>
                </div>
                {#if $authStore.qris.string}
                    <div class="flex w-fit mt-1 w-fit">
                        <a href="#" on:click={showRecentQris}
                           class="items-center pl-3 w-full pr-4 py-2 text-sm text-center text-white bg-pink-700 hover:bg-pink-600 rounded-lg  focus:ring-4 focus:outline-none focus:ring-pink-300 ">
                            <div class="flex flex-row gap-2 justify-between">
                                <span>Tampilkan</span>
                                <span class="icon-[solar--qr-code-bold] w-5 h-5"></span>
                            </div>
                        </a>
                    </div>
                {/if}
            </div>

        </div>

    </div>

    <div class="relative max-w-[50rem] w-full pt-5 pb-3 px-4 bg-wedding-100  border border-wedding-200 rounded-lg  flex gap-3 flex-col ">
        <Bca class="w-24 h-24 fill-wedding-500"></Bca>
        <div class="flex flex-col gap-1 text-wedding-500 ml-1 z-10 w-full">
            <div class="flex flex-row items-center gap-2">
                <span class="icon-[icon-park-twotone--people]"></span>
                <span class="font-bold">Muhammad Nur Annas</span>
            </div>
            <div class="flex w-fit mt-1 w-full">
                <a href="#" on:click={bca}
                   class="items-center pl-3 w-full pr-4 py-2 text-sm text-center text-white bg-wedding-500 hover:bg-wedding-600 rounded-lg  focus:ring-4 focus:outline-none focus:ring-wedding-300 ">
                    <div class="flex flex-row gap-2 justify-between">
                        <span>Salin Nomor Akun BCA</span>
                        <span class="icon-[iconamoon--copy-fill] h-5 w-5"></span>
                    </div>
                </a>
            </div>
        </div>

    </div>

    <div class="relative max-w-[50rem] w-full pt-5 pb-3 px-4 bg-wedding-100  border border-wedding-200 rounded-lg  flex gap-3 flex-col ">
        <ShopeePay class="w-24 h-24 fill-wedding-500"></ShopeePay>
        <div class="flex flex-col gap-1 text-wedding-500 ml-1 z-10 w-full">
            <div class="flex flex-row items-center gap-2">
                <span class="icon-[icon-park-twotone--people]"></span>
                <span class="font-bold">Fransiska Yudha Nugrahaniseta</span>
            </div>
            <div class="flex w-fit mt-1 w-full">
                <a href="#" on:click={shopeePay}
                   class="items-center pl-3 w-full pr-4 py-2 text-sm text-center text-white bg-wedding-500 hover:bg-wedding-600 rounded-lg  focus:ring-4 focus:outline-none focus:ring-wedding-300 ">
                    <div class="flex flex-row gap-2 justify-between">
                        <span>Salin Nomor Akun Shopee Pay</span>
                        <span class="icon-[iconamoon--copy-fill] h-5 w-5"></span>
                    </div>
                </a>
            </div>
        </div>

    </div>
</div>